import React, { useState } from "react";

const App = () => {
  const incMent = () => {
    const [count, setCount] = useState(0);
  };

  return (
    <div>
      <h1>{count}</h1>
      <button onClick={incMent}>incrise {setCount(count + 1)}</button>
    </div>
  );
};

export default App;
